export const mousedOver = (button) => {
    switch (button) {
    case "dashboard": 
        type: 'MOUSED_OVER_DASHBOARD'
    default: 
        return button
}
}



export const mousedOverNews = () => {
    return {
        type: 'MOUSED_OVER_NEWS'
    }
}

export const mousedOffNews = () => {
    return {
        type: 'MOUSED_OFF'
    }
}

export const mousedOverDashboard = () => {
    return {
        type: 'MOUSED_OVER_DASHBOARD'
    }
}

export const mousedOffDashboard = () => {
    return {
        type: 'MOUSED_OFF'
    }
}
